function create_geojson_polygon(parameter) {

    var coordinios = parameter.coordinates;
    var splitted_coords = coordinios.split(",");

    var coordinates = new Array();

    $.each(splitted_coords, function () {
        var tmp = new Array();
        var spl = this.split(' ');
        tmp = [parseFloat(spl[1]), parseFloat(spl[0])];
        coordinates.push(tmp);
    });

    var polygon_object = new Object();
    var poly_array = new Array();


    var geometry = new Object();
    geometry['type'] = "Polygon";
    geometry['coordinates'] = [coordinates];

    var properties = new Object();
    properties['entity_type'] = parameter.entityType;

    $.each(parameter['properties'], function () {
        $.each(this, function (key) {

            properties[this['label']] = this['value'];
        });
    });

    properties['entity_ID'] = parameter.id;
    if (parameter.status) {
        properties['status'] = parameter.status;
    }
    var poly_obj = new Object();
    poly_obj['type'] = "Feature";
    poly_obj['geometry'] = geometry;
    poly_obj['properties'] = properties;

    poly_array.push(poly_obj);
    polygon_object['features'] = poly_array;

    return(polygon_object);

}


function createBaseLayers(config_layers) {
    
    var result = new Object();
    
    $.each(config_layers, function (row) {
        if (this.id) {
            result[this.name] = L.tileLayer(this.link, {
                id: this.id,
                attribution: this.attribution
            });
        } else if (this.ext) {
            result[this.name] = L.tileLayer(this.link, {
                id: this.id,
                attribution: this.attribution,
                maxZoom: this.maxZoom,
                ext: this.ext
            });
        } else {
            result[this.name] = L.tileLayer(this.link, {
                maxZoom: this.maxZoom,
                attribution: this.attribution
            });
        }

    });

    return result;
}

function resetHighlight(e) {
    geojson1.resetStyle(e.target);
    info.update();
}

function zoomToFeature(e) {
    map.fitBounds(e.target.getBounds());
}

function highlightFeature(e) {
    var layer = e.target;

    layer.setStyle({
        weight: 5,
        color: '#666',
        dashArray: '',
        fillOpacity: 0.7
    });

    if (!L.Browser.ie && !L.Browser.opera && !L.Browser.edge) {
        layer.bringToFront();
    }

    // info.update(layer.feature.properties);
}



var info = L.control();

info.onAdd = function (map) {
    this._div = L.DomUtil.create('div', 'info');
    this.update();
    return this._div;
};

info.update = function (props) {

    if (props) {
        var html = '<h4>Building metadata</h4>';
        if (props.Buildings) {
            html = html + '<span>Building: <b>' + props.Buildings + '</b><br /></span>';
        }
        if (props.Buildings_QUARTER) {
            html = html + '<span>Quarter: ' + props.Buildings_QUARTER + '</b><br /></span>';
        }
        if (props.Buildings_STATUS) {
            html = html + '<span>Status: ' + props.Buildings_STATUS + '</b><br /></span>';
        }
        if (props.Buildings_LENGTH) {
            html = html + '<span>Length: ' + props.Buildings_LENGTH + '</b><br /></span>';
        }
        if (props.Buildings_WIDTH) {
            html = html + '<span>Width: ' + props.Buildings_WIDTH + '</b><br /></span>';
        }
        if (props.Buildings_OWNER_1) {
            html = html + '<span style:"max-width:50px; word-wrap:break-word;">Owner: ' + props.Buildings_OWNER_1 + '</b><br /></span>';
        }
        if (props.Buildings_DATE_1) {
            html = html + '<span>Date: ' + props.Buildings_DATE_1 + '</b><br /></span>';
        }
        this._div.innerHTML = html;
    } else {
        this._div.innerHTML = 'Hover over a Building';
    }

};

function return_ids() {

    var result = JSON.parse(localStorage.getItem("search_result"));
    //console.log(result);
    
    var url_string = window.location.href;
    var url = new URL(url_string);
    var app = url.searchParams.get("app");

    var ids = "";
    $.each(result, function (key) {
        ids = ids + "," + this[2];
    });

    if (ids[0] === ",") {
        ids = ids.substring(1);
    }
    console.log(result);
    console.log(ids);
    
    if (app === "geognosis") {
        window.opener.document.getElementById("map_value").value = ids;
        window.onunload = function (e) {
            opener.CallParentfunction();
        };  
        window.close();
    } else {

        window.opener.document.getElementById("showMap").style.display = "none";
        window.opener.document.getElementById("mapCriteriaDiv").style.display = "block";
        window.opener.document.getElementById("mapCriteria").value = ids;
        //alert(window.opener.document.getElementById("mapCriteria").value);
        window.close();
    }
}
