        map.on(L.Draw.Event.CREATED, function (e) {


            if (JSON.parse(localStorage.getItem("search_result")) !== null) {
                search_result = JSON.parse(localStorage.getItem("search_result"));
            }

            $.each((lrs), function () {

                this.eachLayer(function (marker) {

                    var option = ($(marker._popup._content).children().eq(2).text());
                   

                    var html = $(marker._popup._content);
                    var name;
                    var iid;
                    var i = 0;

                    $.each($(html), function () {
                        if (i === 1) {
                            name = $(this).text();
                            name = name.replace("Name : ", "");
                        }
                        if (i === 2) {
                           
                            iid = $(this).text();
                            iid = iid.replace("Entity ID: ", "");
                        }
                        i++;
                    });


                    var coo ;
                    var mode; 
                    
                    if(marker._bounds){
                        coo = marker._latlngs[0];
                        mode = "poly";
                    }else{
                        coo = marker.getLatLng();
                        mode = "point";
                    }

                    if (e.layer.contains(coo)) {

                        var hop = new Array();
                        
                        //console.log(coo)
                        hop.push(coo.lat);
                        hop.push(coo.lng);
                        hop.push(iid);

                        search_result[name] = (hop);
                    }
                    if (!e.layer.contains(coo)) {
                        //console.log(option)
                        $("input[value='Points_" + option + "']").click();
                        $("input[value='Points_" + option + "']").prop('checked', false);
                        
                        $("input[value='Polygons_" + option + "']").click();
                        $("input[value='Polygons_" + option + "']").prop('checked', false);

                        marker.remove();
                        delete search_result[name];
                    }

                });

            });
           // console.log(search_result)
            localStorage.setItem("search_result", JSON.stringify(search_result));
            //console.log();
        });

