        function create_geojson(row, ship_type, ship_name, record_id, chandlers) {

            var j = 0;
            var folder = new Object();

            $.each(row, function (key) {


                if ((key === 'coordinates')) {
                    var ee = (this.toString()).trim().split(' ');
                }


                if ((key === 'coordinates')) {

                    var lat, lon;

                    if ((ee[0]) && (ee[1])) {

                        var pp = ee[0].split(/[^\d\w\.]+/);


                        if (pp.length === 3) {
                            lat = ConvertDMSToDD(pp[0], pp[1], '00', pp[2]);
                        } else if (pp.length === 4) {
                            lat = ConvertDMSToDD(pp[0], pp[1], pp[2], pp[3]);
                        }

                        var qq = ee[1].split(/[^\d\w\.]+/);

                        if (qq.length === 3) {
                            lon = ConvertDMSToDD(qq[0], qq[1], '00', qq[2]);
                        } else if (pp.length === 4) {
                            lon = ConvertDMSToDD(qq[0], qq[1], qq[2], qq[3]);
                        }
                    }

                    if (ee) {

                        //console.log(ee)
                        if (ee[0].indexOf('N') > 0) {

                            var pp = ee[0].split(/[^\d\w\.]+/);

                            if (pp.length === 3) {
                                lat = ConvertDMSToDD(pp[0], pp[1], '00', pp[2]);
                            } else if (pp.length === 4) {
                                lat = ConvertDMSToDD(pp[0], pp[1], pp[2], pp[3]);
                            }
                        } else {
                            lat = ee[0];
                        }

                        if (ee[0].indexOf('N') > 0) {

                            var pp = ee[0].split(/[^\d\w\.]+/);
                            //       console.log(pp)
                            if (pp.length === 3) {
                                lat = ConvertDMSToDD(pp[0], pp[1], '00', pp[2]);
                            } else if (pp.length === 4) {
                                lat = ConvertDMSToDD(pp[0], pp[1], pp[2], pp[3]);
                            } else {
                                lat = ee[0].replace('°N', '');
                            }
                        } else {
                            lat = ee[0];
                        }

                        if (ee[1].indexOf('E') > 0) {

                            var pp = ee[1].split(/[^\d\w\.]+/);
                            if (pp.length === 3) {
                                lon = ConvertDMSToDD(pp[0], pp[1], '00', pp[2]);
                            } else if (pp.length === 4) {
                                lon = ConvertDMSToDD(pp[0], pp[1], pp[2], pp[3]);
                            } else {
                                lon = ee[1].replace('°E', '');
                            }
                        } else {
                            lon = ee[1];
                        }


                    }

                    if ((lat) && (lon)) {


                        var description = "";
                        var point = new Object();

                        if (this.calendar_time) {
                            point['time'] = this.calendar_time;
                            description = this.calendar_time + "\n";
                        }

                        if ((row['id'])) {
                            point['entity_id'] = row['id'];
                        }

                        if ((row['Name'])) {
                            point['name'] = row['Name'];
                        }
                        if ((row['Type'])) {
                            point['type'] = row['Type'];
                        }
                        if ((row['Ονομασία'])) {
                            point['name'] = row['Ονομασία'];
                        }
                        if ((row['Κωδικός'])) {
                            point['id'] = row['Κωδικός'];
                        }

                        if ((row['entity_type'])) {
                            point['entity_type'] = row['entity_type'];
                        }

                        if (ee) {
                            point['coord_from_location'] = true;
                        }

                        var coord = new Object();

                        if ((lon.toString()).indexOf('°') < 0 && (lat.toString()).indexOf('°') < 0) {

                            if ((lat.toString()).indexOf(',') > 0) {
                                coord['latitude'] = parseFloat(lat.replace(/,/g, ''));
                            } else {
                                coord['latitude'] = parseFloat(lat);
                            }

                            coord['lontidute'] = parseFloat(lon);//+ ',' + lat;                                                                                                                                    
                            point['Point'] = coord;

                        } else {
                            //console.log(lat +" "+ lon);
                        }


                        if (this.calendar_date) {
                            point['date'] = this.calendar_date;
                        }
                        if (ship_type) {
                            point["ship_type"] = ship_type;
                        }
                        if (ship_name) {
                            point["ship_name"] = ship_name;
                        }
                        if (record_id) {
                            point["record_id"] = record_id;
                        }

                        point['description'] = description;


                        folder['Placemark_' + j] = point;

                        j++;
                    }
                }
            });

            folder['name'] = 'route';

            var document = new Object();
            document['Folder'] = folder;

            var root = new Object();
            root['Document'] = document;


            if (root) {
                //if (j > 2) {
                // console.log(root)
                return root;

            } else {
                return null;
            }


        }
